import React, { Component } from 'react';

class Pricepage extends Component{
    render(){
        return (
            <section className="resume">
                    <h1>web services.</h1>
                    <p>Hey, would you like for me to create your website and host it? I have a quick price guide below for simple websites, but please fill out the form below and we can talk there. :)</p>

                    <p>
                        Simple static website (includes just coding and hosting):
                        <ul>
                            <li>One page: $1000</li>
                            <li>Two page: $2000</li>
                            <li>Three page: $3000</li>
                            <li>Four pages: $4000</li>
                        </ul>
                    </p>

                    <p>You can also email me at cecitran94@gmail.com for other inquiries on certain website questions.</p>

            </section>
        )
    }
}

export default Pricepage;
